import styled from 'styled-components';

export const Container = styled.main`
  margin-top: 70px;

.grid {
  display: grid;
  grid-gap: 20px;
  list-style: none;
  grid-template-columns: repeat(auto-fill, 300px);
  width: 100%;
  padding: 4%;
}

`
